import { Link, Outlet } from 'react-router-dom';

export default function Servicefordeaf() {
    return (
      <main style={{ padding: "1rem 0" }}>
        <h2>We have these services for you</h2>

        <Link to="/requesttranslator">
          <button >request translator</button></Link>

          <Link to="/training">
          <button >Training</button></Link>


          <Link to="/otherservice">
        <button>all request service</button></Link>




        <Link to="/requestlawyer">
          <button >requestlawyer</button></Link>

          <Link to="/requestdoctor">
          <button >requestdoctor</button></Link>

        <Outlet/>
      </main>
    );
    }
